import{_ as a,o as t,c as e,e as o}from"./chunks/framework.nzJD8CNM.js";const _=JSON.parse('{"title":"ТутШьют","description":"Швейное пространство","frontmatter":{"title":"ТутШьют","description":"Швейное пространство","date":"2018-05-17","icon":"logo.png","cover":"cover.jpg","city":"г. Москва","address":"мкр. Северное Чертаново, 1А","place":"м. Чертановская, ТЦ Авентура, 2 этаж","url":"http://www.sewplace.ru","tel":"+7 (926) 929-7-929","hours":"с 10:00 до 22:00 без выходных","coord":[55.63722217296559,37.60007016950818],"status":"open","facebook":"sewplace","instagram":"sewplace","telegram":"sewplace_mos"},"headers":[],"relativePath":"workshop/catalog/tutshyut/index.md","filePath":"workshop/catalog/tutshyut/index.md"}'),r={name:"workshop/catalog/tutshyut/index.md"},s=o('<h2 id="мое-швеиное-пространство" tabindex="-1">Мое швейное пространство <a class="header-anchor" href="#мое-швеиное-пространство" aria-label="Permalink to &quot;Мое швейное пространство&quot;">​</a></h2><h5 id="швеиное-кафе-ателье-самообслуживания-занятия-по-кроике-и-шитью-—-приходи-пошить" tabindex="-1">Швейное кафе, ателье самообслуживания, занятия по кройке и шитью — Приходи пошить! <a class="header-anchor" href="#швеиное-кафе-ателье-самообслуживания-занятия-по-кроике-и-шитью-—-приходи-пошить" aria-label="Permalink to &quot;Швейное кафе, ателье самообслуживания, занятия по кройке и шитью — Приходи пошить!&quot;">​</a></h5><h3 id="что-тутшьют" tabindex="-1">Что ТутШьют? <a class="header-anchor" href="#что-тутшьют" aria-label="Permalink to &quot;Что ТутШьют?&quot;">​</a></h3><p>Шить можно все, что шьется и на что способны наши выносливые машинки. Нужен совет — подскажем, нужна помощь — поможем, не умеете — научим, сомневаетесь — обсудим!</p><p>Мы предлагаем почасовую аренду полностью оборудованного швейного места. Пользуйтесь всем, что есть в ТутШьют! Машинки, столы, примерочная, гладильный стол, манекены, булавки-иголки-мелки-ножницы-нитки, чай, кофе, диванчик для отдыха!</p><h3 id="зачем-тутшьют" tabindex="-1">Зачем ТутШьют? <a class="header-anchor" href="#зачем-тутшьют" aria-label="Permalink to &quot;Зачем ТутШьют?&quot;">​</a></h3><p><strong>пошить</strong> если нет подходящей машинки, или не хочется затевать пошивочную дома.</p><p><strong>научиться</strong> всему или чему-то особенному, в группе или индивидуально, в выходные или будни</p><p><strong>подшить</strong> все то, что можно было бы отнести в ателье, но дорого, долго и далеко.</p><p><strong>раскроить</strong> тут такие большие столы, что можно раскроить парашют.</p><p><strong>дружить</strong> в дружеской амтосфере ТутШьют единомышленники всегда найдутся.</p><p><strong>заказать</strong> раскрой своей модели платья, блузки, юбки и т.д. (как раньше в «тканях»)</p><h3 id="на-чем-тутшьют" tabindex="-1">На чём ТутШьют? <a class="header-anchor" href="#на-чем-тутшьют" aria-label="Permalink to &quot;На чём ТутШьют?&quot;">​</a></h3><p><strong>JANOME EXACT QUILT 18A (EQ 18A)</strong> все основные швейные операции, полуавтоматическое выполнение петельки для пуговки, подходит для всех тканей</p><p><strong>BERNETTE MOSCOW 5</strong> множество красивых строчек, автоматическое выполнение петельки для пуговки, прошивает даже очень плотные ткани</p><p><strong>ELNA 664 PRO</strong> 4-х ниточный оверлок. Обметывает и сшивает. Мечта многих мастериц</p><p><strong>JANOME COVER PRO</strong> плоскошовная распошивальная машина. Шейте трикотажные обновки легко</p><h3 id="что-еще-в-тутшьют" tabindex="-1">Что еще в ТутШьют? <a class="header-anchor" href="#что-еще-в-тутшьют" aria-label="Permalink to &quot;Что еще в ТутШьют?&quot;">​</a></h3><p>А ещё в ТутШьют есть магазин швейных необходимостей. Нитки, иголки, технические ленты, клеевые материалы, молнии, кнопки, резинки, шпульки и многое другое. И выставка-продажа аксессуаров и украшений ручной работы.</p><h3 id="почем-тутшьют" tabindex="-1">Почём ТутШьют? <a class="header-anchor" href="#почем-тутшьют" aria-label="Permalink to &quot;Почём ТутШьют?&quot;">​</a></h3><p>30 МИНУТ «ЭКСПРЕСС» —150 P 1 ЧАС — 350 P 1 ЧАС «БЕЗ ШВЕЙНЫХ МАШИН» — 200 P «ВЕСЬ ДЕНЬ» — 1100 P ИНДИВИДУАЛЬНО С МАСТЕРОМ — 500 P/ЧАС ЗАНЯТИЯ ПО КРОЙКЕ И ШИТЬЮ — 350 P/ЧАС ИЗГОТОВЛЕНИЕ БАЗОВОГО ЛЕКАЛА — от 500 до 1000 P РАСКРОЙ (ЗАВИСИТ ОТ СЛОЖНОСТИ ИЗДЕЛИЯ) — от 500 до 3000 P АРЕНДА ДЛЯ ПРОВЕДЕНИЯ МАСТЕР-КЛАССА (ДО 5 ЧЕЛОВЕК) — 500 P с человека в день мелкий ремонт мастер поможет выполнить при наличии свободного времени, стоимость зависит от сложности и задействованного времени ЧАЙ И КОФЕ БЕСПЛАТНО</p>',21),n=[s];function p(i,l,h,c,d,g){return t(),e("div",null,n)}const P=a(r,[["render",p]]);export{_ as __pageData,P as default};
